    firstStep(Graph,Vertices,cycle)
    print(cycle,len(Vertices))
    
    while len(Vertices) != 0:
        NextMove = getNextMove(Graph,Vertices,cycle)
        
        if NextMove == None:
            #cycle graph
            permuteCycle(cycle)
            #print(cycle)
            continue
        else:
            continue
    
    
    return cycle
    
    
        
        
    
