"""
Code Challenge: Solve the Eulerian Path Problem.

Input: The adjacency list of a directed graph that has an Eulerian path.
Output: An Eulerian path in this graph.
"""



import networkx as nx
from networkx.algorithms.euler import eulerian_path

def EP(mygraph):
    DG = nx.DiGraph()
    for key in mygraph.keys():
        for value in mygraph[key]:
            DG.add_edge(key,value)
    return DG

def EP_pretty(DG):    

    a = list(eulerian_path(DG))
    print(a)
    
    return [i[0] for i in a] + [a[-1][1]]
    

def Eulerian_path(inputfile):
    

    mygraph = readGraphFile(inputfile)
    print(mygraph)
    DG = EP(mygraph)
    

    a = list(eulerian_path(DG))
    print(a)
    
    return [i[0] for i in a] + [a[-1][1]]

