"""
StringReconstruction(Patterns)
    dB ← DeBruijn(Patterns)
    path ← EulerianPath(dB)
    Text﻿ ← PathToGenome(path)
    return Text
"""

#def OverlapGraphProblem(string_kmers):
    

def DeBruijn(Patterns_string):
        
    d = defaultdict(list)
    
    kmers = Patterns_string.split(' ')
    print(kmers)
    for kmer in kmers:
        suffix = kmer[:-1]
        preffix =  kmer[1:]
        d[suffix].append(preffix)
                
    
    return d
        

def StringReconstruction(Patterns):
    dB = DeBruijn(Patterns)
    path = EP(dB)
    a = EP_pretty(path)
    print(a)
    ans = ''.join([i[0] for i in a] + [i for i in a[-1][1:]])
    print(ans)
    
    
