#%% Universal k strings

def generate_patterns(k):
    pattern_list = ["{0:b}".format(i).zfill(k) for i in range(2**k)]
    return ' '.join(pattern_list)

def universalkstring(k):
    Patterns = generate_patterns(k)
    dB = DeBruijn(Patterns)
    
    path = EP(dB)
    a = EP_pretty(path)
    #print(a)
    ans_list = [i[0] for i in a] + [i for i in a[-1][1:]]
    ans = ''.join(ans_list[:-(k-1)])
    print(ans,len(ans))
    
universalkstring(8)


